                treinos.push({data:'2016-06-01',exercicios:exercicios});
                treinos.push({data:'2016-06-02',exercicios:exercicios});
                treinos.push({data:'2016-06-03',exercicios:exercicios});
                treinos.push({data:'2016-06-04',exercicios:exercicios});
                treinos.push({data:'2016-06-05',exercicios:exercicios});
                treinos.push({data:'2016-06-06',exercicios:exercicios});
                treinos.push({data:'2016-06-07',exercicios:exercicios});
